import React from "react";

class DataDisplay extends React.Component {
  render() {
    const { infoList } = this.props;

    return (
      <div className="dataDisplayDiv">
        <h2>GENERAL INFO</h2>
        {infoList.length > 0 ? (
          <ul className="dataDisplayList">
            {infoList.map((info, index) => (
              <li key={index}>
                <div>
                  <p>
                    Name: {info.name}
                    <br />
                    Email: {info.email}
                    <br />
                    Phone: {info.phone}
                    <br />
                    City: {info.city}
                  </p>
                </div>
              </li>
            ))}
          </ul>
        ) : (
          <p>No info added yet</p>
        )}
      </div>
    );
  }
}

export default DataDisplay;
